import React from "react";
import Card from "../Card/card";
import "./featured.scss";

const Featured = ({type}) => {

    // Edit the image data, links are currently not being displayed

    const data = [
      {
        id: 1,
        img: "/images/coat.jpg",
        img2: "/images/coat.jpg",
        title: "Floral Dress",
        isNew: true,
        oldPrice: 19,
        price: 12,
      },
      {
        id: 2,
        img: "/images/coat.jpg",
        title: "Coat",
        isNew: true,
        oldPrice: 19,
        price: 12,
      },
      {
        id: 3,
        img: "/images/coat.jpg",
        title: "Skirt",
        oldPrice: 19,
        price: 12,
      },
      {
        id: 4,
        img: "https://images.pexels.com/photos/1624248/pexels-photo-1624248.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1",
        title: "Hat",
        oldPrice: 19,
        price: 12,
      },
    ];

    return (
        <div className="featured">
            <div className="top">
                <h1>{type} Products</h1>
                <p>New arrivals and popular picks!</p>
            </div>
            <div className="bottom">
                {data.map(item => (
                    <Card item={item} key={item.id} />
                ))}
            </div>
        </div>
    )
};

export default Featured;
